    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"4a62591e-82f7-4443-80cc-ffc9ec9f27e0","type":"CustomJS"},{"attributes":{"formatter":{"id":"a664ff85-bc9c-4c2c-baed-723a36d51359","type":"BasicTickFormatter"},"plot":{"id":"1bbc30a3-5bad-4a69-aaa6-bcd415e6570f","subtype":"Figure","type":"Plot"},"ticker":{"id":"d8731469-07a4-4230-9961-0604ce00e492","type":"BasicTicker"}},"id":"eaccaaff-e0c5-472c-a624-bc1254b1f825","type":"LinearAxis"},{"attributes":{"callback":null,"column_names":["ecai","lengths","similarity_scores","meanentropy","cai","color","doub","gc","x","y","clusters","nans","species"],"data":{"cai":{"__ndarray__":"jiCeJJbp5j8/t/Lway/mPwLH0f8FZOc/NIqn01Zn4T9htvkTLKHhP3Wj2zPJp+E/x9mo8N2r4T/VSY26CKnhPwJms5jReuA/C0rn82on3D/k2BwLjLfhP3ImbBnG9Nk/0l34LqXV2j+Vmr2Osu3aP2ImnhKb59o/VwU7HGXk3D+H8P6hLcjhP530KBlIEuA/XRw7sdqI6D8QrKGGDUfbPyR0r1TgM+E/pa3rY87x4D9ZQMVHxnbhPzdJeXFsT+k//R+gEEaj4j8VsVHErSbeP0N1Y7A9HeA/qVCXCcL53j8ExY2iG83eP1e1QAKtU94/u3/Dbyqu3j8tLgH6J77fP7SNgG2Q4eE/y6+I/1p74D+2HHTbZUnfP7G5NJQFxd4/ElazZPH53z9ucplJNtzePyQZ2mn01d8/qwGiePLb3z8y5lCJXyDgP6sBonjy298/sNTBUyGf4T9JI+6FFUHfPydPRNtPI+A/6rlkhOEx3z+mktANjbXeP2+PilQWVt8/PB5Soxh73D+UehSXXhndP+UwqmLnZt0/M5N/HsB03j9hheEMnJDmP5wHM4DoEuE/oEFqPp9q3z81O5cNhVXdP0QhO0lPJd0/Voyi2XpO3T/skfJsgqDdP4A8cKsXC90/SfP60pNv3T+so3MQHC3iP2VDPrZaLOI/RGPi60tm4D9kO8TpMwHjPyJLOCW1uN8/O
